"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[821],{821:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Centro del Orgullo del Condado de San Mateo","description":"El Centro del Orgullo del Condado de San Mateo es una organización modelo de colaboración y una parada única para la comunidad LGBTQ+. Ofrecemos programas robustos y servicios para apoyar a los miembros de la comunidad LGBTQ+ de todas las edades, incluyendo educación, capacitación, eventos comunitarios, grupos de apoyo entre pares, programación diaria, terapia clínica y manejo de casos."},{"id":"04f0d550-7d16-415f-ae3f-51740223c48f","slug":"understanding-and-supporting-transsexuality-in-children-and-parents","externalUrl":"https://www.kinderinfo.de/ratgeber/transsexualitaet/","tags":["transmasculine","transfeminine","youth-services","parent-family-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Comprendiendo y Apoyando la Transexualidad en Niños y Padres","description":"Este artículo alemán ofrece una guía completa para familias que lidiar con la transexualidad en padres o niños. Proporciona información sobre procedimientos y recursos clave, ofreciendo orientación desde la comprensión y aceptación de la situación hasta la búsqueda de tratamientos relevantes."},{"id":"07e16941-b605-4cf5-bab5-bdc882c51a1d","slug":"queerspace","externalUrl":"https://www.queerspace.org.au/","tags":["mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness"],"address":"100 Drummond St, Carlton VIC 3053, Australia","phoneNumber":"03 9663 6733","country":"AU","provinceOrState":"VIC","city":"Carlton","county":"City of Melbourne","latLng":[-37.8043894,144.9681606],"email":"enquiries@ds.org.au","socialMedia":{"yelpUrl":null,"googleMapsUrl":null},"title":"Queerspace","description":"Queerspace es un servicio de apoyo para la salud y el bienestar LGBTIQ+ establecido en 2009 por las comunidades LGBTIQ+ para las comunidades LGBTIQ+. Se enfoca en las relaciones, las familias, la crianza y los jóvenes, y ofrece servicios ubicados en la región metropolitana noroeste de Victoria. Los servicios incluyen asesoramiento, gestión de casos, defensa, servicios de apoyo, apoyo entre pares, desarrollo profesional, formación y consultoría."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"Una comunidad online vibrante y un centro de conocimiento para las personas interesadas en la terapia hormonal de reemplazo (HRT) por sí mismos.  Su sitio web está dedicado a proporcionar un espacio seguro e inclusivo donde las personas pueden acceder a información, recursos y apoyo para la HRT administrada por uno mismo. Ya sea que estés explorando métodos alternativos, buscando orientación sobre la dosis y la administración, o simplemente deseas conectar con otras personas que comparten experiencias similares, DIYHRT.cafe ofrece una gran cantidad de valiosos conocimientos, historias personales y asesoramiento de expertos para ayudarte a tomar decisiones informadas sobre tu salud y bienestar."},{"id":"0df181cd-6431-4f05-a79f-6ae5c8e3f79b","slug":"stuttgarter-declaration-gender-self-determined","externalUrl":"https://die-erklaerung.de/","tags":["legal","healthcare","mental-health","education-awareness"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":"BW","city":"Stuttgart","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Declaración de Stuttgart: Género. Auto. Determinado.","description":"La Declaración de Stuttgart destaca la importancia del trato respetuoso hacia las personas transgénero e intersexuales. Subraya la significancia de los derechos humanos en los servicios médicos, psicoterapéuticos, de asesoramiento y de apoyo para individuos transgénero e intersexuales. Desarrollada por médicos, psicoterapeutas, activistas de los derechos humanos y personas afectadas, enfatiza el derecho a determinar el propio género y la obligación de que los tratamientos médicos respeten esta autodeterminación."},{"id":"11cfde25-5434-4fae-b782-c9597ebe52f3","slug":"deifydeify-qtibipoc-collective","externalUrl":"https://linktr.ee/deifycbr","tags":["social-services","support-groups","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"QTIBIPOC Canberra Facebook Group"},"title":"Colectivo DEiFYDEiFYQTIBIPOC residiendo en Ngunnawal, Ngunawal y País Ngambri","description":"Esta es una reunión colectiva para la comunidad DEiFYQTIBIPOC. El grupo también discutirá sobre el Zine de Masculinidades Queer y su lista de reproducción específica."},{"id":"1665b1de-c17a-4c22-ace3-d635d35ef2b9","slug":"bundesverband-trans","externalUrl":"https://www.bundesverband-trans.de/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","education-awareness","support-groups"],"address":"Prinzregentenstraße 84, 10717 Berlin, Germany","phoneNumber":"+49 (0) 30 – 23 94 98 96","country":"DE","provinceOrState":"BE","city":"Berlin","latLng":[52.4890033,13.3333558],"email":"info@bv-trans.de","socialMedia":null,"town":"Bezirk Charlottenburg-Wilmersdorf","title":"Bundesverband Trans* e.V.","description":"Bundesverband Trans* e.V. es una asociación nacional que aboga por los derechos de las personas trans* en Alemania, incluyendo a aquellos que se identifican como transexuales, transgénero, género queer, no binarios y trans*. Su objetivo es la reforma legal, política y médica para mejorar las condiciones de esta comunidad mediante la organización de talleres, ofreciendo consultas y publicando publicaciones."},{"id":"1873eb7a-2dcb-4346-bf6b-91a97237072f","slug":"nsw-service-for-the-treatment-and-rehabilitation-of-torture-and-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services"],"phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"twitterUrl":"https://twitter.com/starttsNSW","facebookUrl":"https://www.facebook.com/STARTTSNSW","instagramUrl":"https://www.instagram.com/startts_nsw/","linkedinUrl":"https://www.linkedin.com/company/startts/","youtubeUrl":"https://www.youtube.com/user/starttsvideos"},"county":"City of Fairfield","title":"Servicio de NSW para el Tratamiento y Rehabilitación de Sobrevivientes de Tortura y Trauma","description":"STARTTS es una organización especializada, sin fines de lucro, que proporciona tratamiento psicológico culturalmente relevante, apoyo e intervenciones comunitarias para ayudar a las personas y comunidades a sanar de la tortura y el trauma de refugiados y reconstruir sus vidas en Australia. También apoyan a individuos LGBTQIA+ de orígenes de refugiados y solicitantes de asilo."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"Una plataforma en línea integral dedicada a apoyar a las personas que están haciendo la transición de femenino a masculino (FTM). Su sitio web sirve como un recurso de confianza, que ofrece una gran cantidad de información, orientación y conexiones comunitarias para aquellos que inician su viaje FTM. Desde consejos prácticos sobre terapia hormonal y opciones quirúrgicas hasta apoyo de salud mental e historias personales, FTMGuide.org tiene como objetivo empoderar a las personas con el conocimiento y los recursos que necesitan para navegar su transición con confianza y claridad."},{"id":"192cec64-3c1a-43eb-bfcf-9dfe3372842c","slug":"black-rainbow","externalUrl":"https://blackrainbow.org.au/","tags":["mental-health","support-groups","community-stories","education-awareness"],"address":"Darwin NT, Australia","phoneNumber":null,"country":"AU","provinceOrState":"NT","city":"Darwin","latLng":[-12.4637333,130.8444446],"email":null,"socialMedia":{"instagram":"https://www.instagram.com/blackrainbowaus/","twitter":"https://twitter.com/BlkRnBow","facebook":"https://www.facebook.com/blackrainbowaus/","linkedin":"https://www.linkedin.com/company/black-rainbow/","youtube":"https://www.youtube.com/c/BlackRainbowAustralia"},"title":"Arco Iris Negro","description":"Arco Iris Negro es una empresa social voluntaria aborigen y de las Islas del Estrecho de Torres LGBQTIA+SB a nivel nacional centrada en la salud y el bienestar de su comunidad. Esta se esfuerza por extender sus servicios, a pesar de no tener financiación, a través de donaciones, pago por servicio y ventas de materiales educativos. Inician proyectos de alcance, apoyan eventos sociales y reúnen fondos para el mejoramiento de la comunidad y la investigación sobre los impactos en la salud."},{"id":"19d3bf2d-04ed-46e6-ac5b-b2e3c26a7dd1","slug":"minus-eighteen","externalUrl":"https://www.minus18.org.au/","tags":["youth-services","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Minus18","description":"Minus18 es una organización benéfica de Australia que mejora la vida de los jóvenes LGBTQIA+. Combaten el aislamiento social creando espacios donde los jóvenes pertenecen, son celebrados y pueden hacer amigos. También ofrecen capacitación LGBTQIA+, recursos y campañas digitales, con el objetivo de crear una Australia libre de discriminación. Su objetivo es dotar a los jóvenes de las habilidades y oportunidades que necesitan para estar a la vanguardia del cambio."},{"id":"1d1d694e-b73a-4c37-ae8b-288fbc81a489","slug":"us-trans-survey","externalUrl":"https://www.ustranssurvey.org/","tags":["education-awareness","community-stories","non-binary","transmasculine","transfeminine"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":"ustranssurvey@transequality.org","socialMedia":null,"title":"Encuesta Trans de EE. UU.","description":"La Encuesta Trans de EE. UU. es la encuesta más grande de personas trans, realizada por personas trans, en los Estados Unidos. Documenta las vidas y experiencias de personas trans y no binarias de 16 años o más en los EE. UU. y los territorios de EE. UU. La encuesta y sus informes han sido un recurso vital, incluyendo informes sobre las experiencias de personas de color y por estado, ayudando a dar forma al futuro a través de las voces trans."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"Una plataforma en línea pionera dedicada a proporcionar investigación basada en evidencia, educación y recursos para la comunidad transgénero y no binaria, con un enfoque particular en la terapia hormonal feminizante (FHT). Su sitio web sirve como un centro vital para las personas que buscan información confiable y actualizada sobre los aspectos médicos, fisiológicos y psicológicos de la FHT. A través de su exhaustiva colección de estudios revisados por pares, artículos de expertos y guías prácticas, su sitio empodera a las personas para tomar decisiones informadas sobre su transición y salud."},{"id":"1ff064d4-6b1e-44e9-8b83-5e4e14d9f1ce","slug":"nonbinary-ch-a-resource-for-non-binary-individuals","externalUrl":"https://www.nonbinary.ch/","tags":["non-binary","education-awareness"],"address":null,"phoneNumber":null,"country":"CH","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"youtubeUrl":"https://www.youtube.com/channel/","pinterestUrl":"https://www.pinterest.com/nonbinarych/"},"title":"nonbinary.ch - Un Recurso para Individuos No Binarios","description":"Un sitio web suizo exhaustivo que proporciona información y recursos relacionados con las identidades de género no binarias. Está destinado a ayudar a las personas que exploran su propia identidad de género, o a aquellas que interactúan con individuos no binarios, al hacer que el conocimiento fundamental sea fácilmente accesible. El sitio también alberga un blog, un boletín informativo y enlaces a recursos externos relevantes como libros, películas e investigaciones."},{"id":"2db72f6f-a5bc-4784-931d-dbe46b9657c6","slug":"the-pinnacle-foundation","externalUrl":"https://thepinnaclefoundation.org/","tags":["education-awareness","financial-aid-scholarships","youth-services"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"La Fundación Pinnacle","description":"La Fundación Pinnacle es una organización benéfica de educación australiana que proporciona becas, mentoría y oportunidades a jóvenes australianos LGBTQIA+. Las becas se otorgan para estudios a tiempo completo en instituciones públicas de educación superior en Australia."},{"id":"2f23a24b-2e9d-4f83-9808-1e69981fba12","slug":"ftm-portal-net","externalUrl":"https://ftm-portal.net","tags":["transmasculine","education-awareness","support-groups"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"FTM-Portal.net","description":"FTM-Portal.net es la plataforma de información de habla alemana más grande para hombres trans y otras transmasculinidades que proporciona experiencias y consejos sobre diversas situaciones de vida. Este recurso es útil para cualquier persona asignada como mujer al nacer que no se identifica completamente o parcialmente con esta clasificación inicial. Los familiares de hombres trans y otras partes interesadas también pueden registrarse."},{"id":"2f6aa929-342d-4f12-a6a1-238cec4628ae","slug":"tgns-transgender-network-switzerland","externalUrl":"https://www.tgns.ch/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","education-awareness","youth-services","support-groups","parent-family-resources","partner-resources"],"address":null,"phoneNumber":null,"country":"CH","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/transgenderch","twitterUrl":"https://twitter.com/tgnsch","instagramUrl":"https://www.instagram.com/tgns.ch/"},"title":"TGNS Transgender Network Suiza","description":"TGNS es una red para personas transgénero en Suiza. Proporcionan defensa legal, trabajan hacia las reformas de salud y ofrecen recursos de salud mental a la comunidad transgénero. Se involucran en una variedad de programas de concientización y educación destinados a crear un ambiente de apoyo e inclusivo para las personas que se identifican como transmasculinas, transfemininas y no binarias. TGNS también tiene servicios juveniles, grupos de apoyo y recursos para la familia y los socios de las personas transgénero."},{"id":"3077e7a8-0764-4705-b4fd-95f63cf4f778","slug":"medicijnkosten-medication-costs-information","externalUrl":"https://www.medicijnkosten.nl/","tags":["healthcare","financial-aid-scholarships"],"address":null,"phoneNumber":null,"country":"NL","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Medicijnkosten - Información sobre los costos de los medicamentos","description":"Una plataforma informativa que proporciona detalles sobre los costos de los medicamentos. Ofrece datos sobre el reembolso de medicamentos y alternativas disponibles para individuos que pueden no poder costear ciertos medicamentos. Importante para la planificación financiera de la atención sanitaria."},{"id":"313b4214-64cb-412e-a12e-06cf3ec67654","slug":"open-doors-youth-service","externalUrl":"https://www.opendoors.net.au/","tags":["mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"QLD","city":null,"county":"South East Queensland","latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/opendoorsyouthservice/"},"title":"Open Doors Youth Service","description":"Apoyando a los jóvenes LGBTIQAP+ y a sus familias en el Sureste de Queensland. Proporcionando servicios como asesoramiento para la salud mental, programas de terapia grupal, apoyo social, proporcionando alimentos esenciales y artículos de higiene, asegurando un empleo estable y vivienda, y realizando formación y educación con escuelas, lugares de trabajo y familias."},{"id":"313cd7c6-1051-437c-a1d1-b1297f4c49a8","slug":"stonewall-medical-centre-sexual-health-clinic-brisbane","externalUrl":"https://www.stonewall.com.au/","tags":["healthcare","HIV","STI","sex-workers","transfeminine","transmasculine","non-binary"],"address":"52 Newmarket Rd, Windsor QLD 4030, Australia","phoneNumber":"07 3857 1222","country":"AU","provinceOrState":"QLD","city":"Windsor","county":"Brisbane","latLng":[-27.4378562,153.0279458],"email":null,"socialMedia":null,"title":"Stonewall Centro Médico y Clínica de Salud Sexual – Brisbane","description":"El Centro Médico Stonewall ha estado orgullosamente al servicio de la salud general y la salud sexual de la comunidad lesbiana, gay, bisexual, transgénero, intersexual y en cuestión / queer (LGBTQIA+), trabajadores sexuales y la comunidad heterosexual / directa de Brisbane desde 1995. La clínica proporciona una variedad de servicios incluyendo HIV PEP y PrEP, pruebas de ITS, consultas para trabajadores del sexo, atención médica para personas de género diverso y transgénero, seguimiento de esteroides y drogas para mejorar la imagen, y referencias entre otros."},{"id":"3143b616-c478-4c99-9cbd-ed16c89a1c70","slug":"meridian-support","externalUrl":"https://www.meridianact.org.au/","tags":["healthcare","support-groups","education-awareness","community-stories"],"address":"Havelock House, 85 Northbourne Ave, Turner ACT 2612, Australia","phoneNumber":"(02) 6257 2855","country":"AU","provinceOrState":"ACT","city":"Turner","latLng":[-35.2736943,149.1291121],"email":"contact@meridianact.org.au","socialMedia":null,"title":"Meridian","description":"Meridian ha estado abogando y apoyando a la comunidad LGBTIQA+ durante más de 40 años, ofreciendo una variedad de servicios y programas en la región de Canberra, como servicios de VIH, servicios de bienestar, programas de divulgación para trabajadores sexuales y más."},{"id":"34974bb4-5b32-4157-8820-250bef7a47a8","slug":"australian-transgender-support-association-of-queensland","externalUrl":"https://www.atsaq.org.au/","tags":["non-binary","support-groups","community-stories","social-services"],"address":"Booval QLD 4304, Australia","phoneNumber":"(07) 3705 7663","country":"AU","provinceOrState":"QLD","city":"Booval","county":"City of Ipswich","latLng":[-27.614358,152.788861],"email":"parker@atsaq.org.au","socialMedia":null,"title":"Asociación de Apoyo Transgénero Australiana de Queensland","description":"El organismo principal de Queensland que representa a individuos transgénero, de diversidad de género y no binarios desde 1990. Proporcionan apoyo, defensa, servicios y organizan eventos sociales para servir a la comunidad transgénero."},{"id":"377cdcad-ac8e-491b-96aa-13a91886c07a","slug":"jim-collins-foundation","externalUrl":"https://jimcollinsfoundation.org/","tags":["healthcare","financial-aid-scholarships"],"address":"New York, NY 10150, USA","phoneNumber":null,"country":"US","provinceOrState":"NY","city":"New York","county":"New York County","latLng":[40.7582228,-73.9704871],"email":null,"socialMedia":null,"town":"Manhattan","title":"Fundación Jim Collins","description":"La misión de la Fundación Jim Collins (JCF) es proporcionar asistencia financiera a personas transgénero para cirugías de afirmación de género. Esta fundación ofrece dos opciones de becas; La Beca de los Fundadores que cubre el 100% de los costos quirúrgicos y El Fondo de Legado de Krysallis Anne Hembrough que cubre el 50% de los costos quirúrgicos. La fundación tiene como objetivo proporcionar acceso a estas cirugías vitales para aquellos que lo desean pero debido a la prevalente discriminación contra las personas transgénero, tales costos suelen ser imposibles de cubrir."},{"id":"397b0b03-c59f-46aa-93aa-14170895e5dd","slug":"transgender-india-transition-guide","externalUrl":"https://transgenderindia.com/","tags":["legal","healthcare","mental-health","education-awareness"],"address":null,"phoneNumber":null,"country":"IN","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":"enquiry@transgenderindia.com","socialMedia":null,"title":"India Transgénero: Tu Guía de Transición","description":"India Transgénero ofrece cursos completos, artículos y recursos para la comunidad transgénero en India. Incluye temas que van desde los fundamentos de la terapia de reemplazo hormonal, derechos legales y protecciones, hasta transiciones sociales, con cursos dirigidos por especialistas de varios campos."},{"id":"3a95da73-255a-41db-a65c-233c1f236c3b","slug":"queermed-deutschland-directory","externalUrl":"https://queermed-deutschland.de/","tags":["healthcare","transmasculine","non-binary","transfeminine"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"twitterUrl":"https://twitter.com/queermeddeutschland","instagramUrl":"https://instagram.com/queermeddeutschland","linkedinUrl":"https://linkedin.com/company/queermeddeutschland","facebookUrl":"https://facebook.com/queermeddeutschland"},"title":"Directorio Queermed Deutschland","description":"Queermed Deutschland es un directorio de médicos, terapeutas y prácticas recomendados por la comunidad LGBTQIA+ en Alemania. El objetivo es combatir la discriminación en el sistema de atención de la salud, asegurando una atención de la salud respetuosa y sensible para todos. Incluye varias opciones adicionales en el cuestionario anónimo para atender a diversas personas dentro de la comunidad."},{"id":"3b112584-39e6-4ef6-9e75-a465acdea54c","slug":"northern-territory-aids-and-hepatitis-council-inc","externalUrl":"https://www.ntahc.org.au/","tags":["healthcare","social-services","education-awareness"],"address":"46 Woods St, Darwin City NT 0800, Australia","phoneNumber":"08 8944 7777","country":"AU","provinceOrState":"NT","city":"Darwin City","county":"City of Darwin","latLng":[-12.4602736,130.8432107],"email":"info@ntahc.org.au","socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://www.google.com/maps?q=46+Woods+StreetDARWIN+NT+0800"},"title":"Consejo del Territorio del Norte sobre el SIDA y la Hepatitis Inc.","description":"Una respuesta comunitaria a los virus transmitidos por la sangre en el Territorio del Norte, con el objetivo de eliminar su transmisión. Ofrece una variedad de servicios como apoyo a la vida LGBTI, promoción de la divulgación a trabajadores sexuales y proporciona promoción de la salud y clínicas de salud."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"Un recurso en línea confiable para personas que buscan conocimiento, apoyo y comprensión sobre la disforia de género. Su sitio web proporciona una gran cantidad de información, recursos y conexiones comunitarias para empoderar a las personas en su viaje. Desde guías completas sobre identidad de género y transición hasta historias personales y consejos de expertos, se esfuerzan por crear un espacio seguro e inclusivo para todos."},{"id":"3f865b77-21e6-472e-be98-b2cfd999dafb","slug":"unitarian-universalist-association","externalUrl":"https://www.uua.org/","tags":["non-binary","support-groups","education-awareness","spiritual"],"address":"24 Farnsworth St, Boston, MA 02210, USA","phoneNumber":"(617) 742-2100","country":"US","provinceOrState":"MA","city":"Boston","county":"Suffolk County","latLng":[42.35163259999999,-71.04857050000001],"email":"info@uua.org","socialMedia":null,"title":"Asociación Unitaria Universalista","description":"Una comunidad espiritual de mente abierta y corazón abierto que apoya a las personas para llevar vidas de justicia, amor, aprendizaje y esperanza. La comunidad abraza la diversidad, incluyendo a la comunidad transgénero, y fomenta la participación activa en actos de justicia. También ofrecen recursos, apoyo y defensa para varios problemas sociales."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Proyecto de Avance del Movimiento","description":"El Proyecto de Avance del Movimiento (MAP, por sus siglas en inglés) es un laboratorio de ideas independiente y sin fines de lucro que proporciona investigación rigurosa, insight y comunicaciones que ayudan a acelerar la igualdad y las oportunidades para todos. MAP trabaja para garantizar que todas las personas tengan una oportunidad justa de buscar salud y felicidad, ganarse la vida, cuidar a los que aman, estar seguros en sus comunidades y participar en la vida cívica."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"Servicios de Comunicación de Jordan Ross","description":"Jordan Ross ofrece entrenamiento en habla, voz y comunicación para personas trans, queer y de género no conformes. Ofrece coaching 1-a-1, cursos en línea, eventos y el \'Programa de Coaching La Voz Interior\'. Su enfoque incorpora programación neurolingüística, hipnoterapia, instrucción de yoga, y coaching de respiración, con el objetivo de abordar no solo los aspectos físicos, sino también los mentales, emocionales y energéticos de la comunicación."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"Portal de Educación en línea de Gender Dynamix","description":"Gender Dynamix es una organización no gubernamental con sede en África que tiene como objetivo promover, avanzar y proteger los derechos humanos de las comunidades trans y de diversidad de género en Sudáfrica y en toda el sur de África. La organización realiza labores de defensa, facilita la construcción de capacidades y proporciona servicios directos a la comunidad. También ofrecen recursos en línea relacionados con atención sanitaria, programas educativos y reconocimiento legal del género."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Proyecto de Ley Sylvia Rivera (SRLP)","description":"El Proyecto de Ley Sylvia Rivera trabaja para garantizar que todas las personas sean libres de autodeterminar su identidad y expresión de género, sin importar ingresos o raza, y sin enfrentar acoso, discriminación o violencia. SRLP proporciona ayuda legal, organiza campañas, realiza capacitaciones y dirige un Comité Asesor de Prisioneros. Se fomenta la participación de la comunidad a través de donaciones, voluntariado y membresía."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"Erin en la mañana","description":"Noticias y discusión sobre legislación trans y la vida. Por Erin Reed · Más de 38,000 suscriptores"},{"id":"4a930816-9948-45d7-9513-393087685a01","slug":"trans-health-sa","externalUrl":"https://www.transhealthsa.com/","tags":["healthcare","legal","social-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"SA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/TransHealthSA","googleMapsUrl":null,"yelpUrl":null},"title":"Trans Health SA","description":"Trans Health SA es un grupo de voluntarios que existe para proporcionar información y apoyo para las necesidades de salud de las personas trans y de género diverso en Australia del Sur. Proporciona listas de profesionales respetuosos, información médica y legal, información sobre agencias de apoyo, organizaciones, publicaciones, grupos sociales y de apoyo, y recursos creados por la comunidad transgénero."},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"Una plataforma en línea innovadora que tiene como objetivo crear un recurso completo y actualizado para los derechos LGBTQ+ globales. Su sitio web proporciona una base de datos centralizada de leyes, políticas y actitudes sociales hacia los derechos LGBTQ+ en todo el mundo. Al mapear y visualizar datos sobre igualdad, inclusividad y protecciones legales, EqualDex.com ofrece una herramienta poderosa para activistas, investigadores e individuos que buscan comprender y abogar por los derechos LGBTQ+ a escala global. Explore sus mapas interactivos, perfiles específicos de países y manténgase informado sobre los últimos avances y desafíos que enfrenta la comunidad LGBTQ+ en todo el mundo."},{"id":"539168d5-49aa-492c-bfb0-d0a1d9bba1eb","slug":"gender-affirmative-letter-access-project","externalUrl":"https://thegalap.org/","tags":["healthcare","mental-health"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"El Proyecto de Acceso a la Carta Afirmativa de Género","description":"El GALAP es una plataforma para clínicos independientes que proporcionan atención afirmativa de género. Ofrecen recursos como directorios de terapeutas, guías de escritura de cartas para la afirmación de género y más. Por favor, tenga en cuenta que las habilidades o la experiencia de cualquier firmante de la promesa no pueden ser verificadas por GALAP."},{"id":"581b9bb9-0e33-4887-8bf0-0dda3781202c","slug":"a-gender-agenda","externalUrl":"https://genderrights.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness","financial-aid-scholarships"],"address":null,"phoneNumber":"(02) 6162 1924","country":"AU","provinceOrState":null,"city":"Canberra","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Una Agenda de Género","description":"Una Agenda de Género trabaja con y en nombre de las personas intersexuales, trans y de género diverso, sus amigos, familias y aliados. A través de la educación, la defensa, el apoyo entre pares y las redes profesionales, AGA conecta a las personas entre sí y se basa en las experiencias colectivas. Ofrecen numerosos eventos y recursos para la comunidad, incluyendo grupos de apoyo, capacitación, recursos educativos. Proporcionan defensa y línea de ayuda en crisis."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands For Trans es una red mundial de industrias y organizaciones de belleza y bienestar que buscan crear e inspirar experiencias seguras y positivas para todos los invitados, especialmente los invitados de la comunidad trans."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Centro Pacífico para el Crecimiento Humano","description":"Fundado en 1973, el Centro Pacífico para el Crecimiento Humano es el centro LGBTQIA+ más antiguo del Área de la Bahía, el tercero más antiguo de la nación, y opera la única clínica de salud mental a escala variable para personas LGBTQIA+ y QTBIPOC y sus familias en el condado de Alameda."},{"id":"5ac3fd1a-2d29-4001-b51c-d3b62d81e090","slug":"transgender-victoria","externalUrl":"https://tgv.org.au/","tags":["transmasculine","transfeminine","non-binary","legal","healthcare","mental-health","social-services","support-groups","parent-family-resources","partner-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"VIC","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/TransGenderVictoria/","twitterUrl":"https://twitter.com/transgendervic","instagramUrl":"https://www.instagram.com/transgendervic/"},"title":"Transgénero Victoria","description":"TGV es el organismo líder de Victoria para personas trans y de género diverso. Trabajamos para lograr justicia, equidad e inclusión para nuestras comunidades, sus parejas, familias, amigos y aliados. Proporcionamos diversos recursos, capacitación, defensa y servicios de apoyo dirigidos a los resultados sociales, económicos, de salud, bienestar y salud mental para la comunidad transgénero."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Centro Comunitario LGBTQ de Oakland","description":"El primer centro de servicio comunitario LGBTQ inclusivo y para todas las edades sin fines de lucro 501c3 de Oakland. Los servicios ofrecidos incluyen grupos de apoyo, soporte de salud mental, asistencia de vivienda, programa juvenil, clínica legal, despensa de alimentos, etc. También se realizan programas especiales para personas LGBTQ+ de edad avanzada y miembros de la comunidad transgénero."},{"id":"6b4856a7-8cc7-4935-b5ee-bd6ca0dd9a4c","slug":"plume-transgender-nonbinary-healthcare","externalUrl":"https://getplume.co/","tags":["transmasculine","non-binary","transfeminine","healthcare","support-groups"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"twitter":"https://twitter.com/getplume","instagram":"https://www.instagram.com/getplume/","youtube":"https://www.youtube.com/channel/UC_n1AJ_PeVNSPt14kjmSeTw","linkedin":"https://www.linkedin.com/company/plume-healthcare","tiktok":"https://www.tiktok.com/@get.plume"},"title":"Plume","description":"El mayor proveedor de atención médica para la comunidad trans y no binaria que ofrece una gama de servicios que incluyen terapia hormonal afirmativa de género y apoyo para la transición a medicamentos para la ansiedad y la depresión. Los servicios son proporcionados por un equipo liderado por trans, con una profunda comprensión de las necesidades únicas de atención médica de la comunidad, con el objetivo de hacerte sentir cómodo, visto y cuidado. Un lugar donde puedes ser tu auténtico yo y obtener la atención que necesitas."},{"id":"6bf639a8-0301-4061-80c2-7738672b036f","slug":"trans-in-3-steps","externalUrl":"https://johanna4711.github.io/Trans-in-3-Schritten/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","education-awareness","voice-training"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":"johanna4711@zohomail.eu","socialMedia":{"githubUrl":"https://github.com/johanna4711/Trans-in-3-Schritten"},"title":"Trans* en 3 Pasos","description":"Un proyecto que sirve como guía para ayudar durante la transición de un individuo. Incluye terminología relacionada con trans*, información sobre cómo saber si uno es trans*, recursos para asesoramiento psicológico, procedimientos médicos, historias anecdóticas de coming out, información legal sobre el cambio de nombres y estado de género, así como enlaces a varios recursos y servicios."},{"id":"6f38810d-896c-4493-afe2-b612021122fc","slug":"the-shed-melbourne","externalUrl":"https://www.theshedsupport.org.au/","tags":["transmasculine","mental-health","support-groups","healthcare","social-services"],"address":"412 Lygon St, Brunswick East VIC 3057, Australia","phoneNumber":null,"country":"AU","provinceOrState":"VIC","city":"Brunswick East","county":"City of Merri-bek","latLng":[-37.76497579999999,144.9730678],"email":null,"socialMedia":null,"title":"The Shed Melbourne","description":"Un grupo de apoyo con sede en Melbourne para individuos transmasculinos, que ofrece varios eventos y recursos como reuniones de apoyo entre pares, clubes de gimnasia, clubes de lectura, recursos de salud mental, información y apoyo sobre cirugía y testosterona, programas de binder, y más."},{"id":"7510c3ea-47b1-4a60-bfaf-bb98b6f6b5b2","slug":"mapping-attacks-on-lgbtq-rights-in-u.s.-state-legislatures","externalUrl":"https://www.aclu.org/legislative-attacks-on-lgbtq-rights","tags":["legal"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Mapeo de Ataques a los Derechos LGBTQ en las Legislaturas Estatales de EE. UU.","description":"En los últimos años, los estados han promovido un número récord de proyectos de ley que atacan los derechos LGBTQ, especialmente a los jóvenes transgénero. La ACLU está rastreando estos ataques y trabajando con nuestra red nacional de afiliados para apoyar a las personas LGBTQ en todas partes. Mientras cada vez más estados trabajan cada año para aprobar leyes que protegen a las personas LGBTQ, las legislaturas estatales están promoviendo proyectos de ley que se dirigen contra personas transgénero, limitan protecciones locales y permiten el uso de la religión para discriminar. La ACLU no dejará de hablar contra estos crueles ataques a nivel nacional."},{"id":"75f35c41-274e-4047-bd13-42f7822a5651","slug":"national-queer-trans-therapists-of-color-network","externalUrl":"https://www.nqttcn.com/","tags":["mental-health","social-services"],"address":"Baltimore, MD 21211, USA","phoneNumber":null,"country":"US","provinceOrState":"MD","city":"Baltimore","latLng":[39.3289463,-76.63838319999999],"email":"info@nqttcn.com","socialMedia":{"facebookUrl":"Facebook-f","twitterUrl":"Twitter","instagramUrl":"Instagram"},"title":"Red Nacional de Terapeutas Queer y Trans de Color","description":"La Red Nacional de Terapeutas Queer y Trans de Color es una organización de justicia de sanación comprometida con la transformación de la salud mental para las personas queer y trans de color. Trabajan en la intersección de los movimientos por la justicia social y el campo de la salud mental."},{"id":"79fdc5af-520b-45bc-a634-7af3d030db42","slug":"shinesa","externalUrl":"https://shinesa.org.au/","tags":["healthcare","education-awareness","mental-health","social-services","support-groups"],"address":"64C Woodville Rd, Woodville SA 5011, Australia","phoneNumber":"8300 5300","country":"AU","provinceOrState":"SA","city":"Woodville","latLng":[-34.87943560000001,138.536817],"email":"info@shinesa.org.au","socialMedia":null,"county":"Charles Sturt","title":"SHINE SA","description":"Una organización de salud en Australia del Sur que proporciona servicios clínicos, asesoramiento en salud sexual y educación y formación relacionada con la salud sexual y reproductiva y habilidades relacionales. También proporciona apoyo y servicios inclusivos para la comunidad LGBTIQA+. También participan en la celebración y defensa de los derechos y el reconocimiento de las comunidades transgénero y de diversidad de género internacionales."},{"id":"7a817d4c-02db-4c00-9988-6c2dbf63a7d4","slug":"zoe-belle-gender-collective","externalUrl":"https://zbgc.org.au/","tags":["education-awareness","social-services","support-groups"],"address":"58 Mundy St, Bendigo VIC 3550, Australia","phoneNumber":"0467 569 635","country":"AU","provinceOrState":"VIC","city":"Bendigo","county":"Greater Bendigo","latLng":[-36.7605293,144.2860065],"email":"contact@zbgc.org.au","socialMedia":null,"title":"Zoe Belle Gender Collective","description":"Zoe Belle Gender Collective es una organización de defensa liderada por personas trans y de género diverso que ofrece formación profesional, talleres y apoyo para la comunidad LGBTQI+. Proporciona recursos y asistencia para servicios comunitarios, trabajadores, familias y amigos, e individuos trans y de género diverso. También lanzó recientemente Transfemme, una iniciativa preventiva contra la violencia de los hombres cis hacia las mujeres trans."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"Diversidad de Género","description":"La Diversidad de Género mejora el bienestar de los niños y adultos de todas las identidades y expresiones de género al proporcionar educación, aumentar la conciencia y ofrecer una visión de la gama más amplia de experiencias humanas. También ayudamos a crear entornos de apoyo y no discriminatorios en escuelas, equipos deportivos, lugares de trabajo y proveedores de atención médica para personas transgénero y de género diverso."},{"id":"83a5458b-864a-4180-a176-b291ffbc7cfb","slug":"nsw-treatment-and-rehabilitation-torture-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services","education-awareness"],"address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","county":"City of Fairfield","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"googleMapsUrl":null,"linkedinUrl":null,"facebookUrl":null,"youtubeUrl":null},"title":"Servicio de NSW para el Tratamiento y Rehabilitación de Sobrevivientes de Tortura y Trauma","description":"STARTTS proporciona tratamiento psicológico culturalmente relevante, intervenciones comunitarias y capacitación a servicios para ayudar a las personas a sanar de las cicatrices de la tortura y el trauma de los refugiados. Su objetivo es crear un ambiente seguro y de apoyo para diversas sexualidades, géneros y cuerpos, incluyendo refugiados y solicitantes de asilo."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"Centro Nacional para la Igualdad Transgénero","description":"El Centro Nacional para la Igualdad Transgénero es una organización que aboga por cambiar políticas y actitudes sociales para aumentar la comprensión y aceptación de las personas transgénero. El NCTE proporciona información sobre temas que afectan a la comunidad Transgénero, incluyendo el envejecimiento, la anti-violencia, el empleo, las familias, la salud y el VIH, la vivienda y la falta de hogar, y más."},{"id":"87ef5091-eaa3-4740-b07f-11a889ead435","slug":"transgender-law-center","externalUrl":"https://transgenderlawcenter.org/","tags":["transmasculine","transfeminine","legal","healthcare","education-awareness"],"address":"Oakland, CA 94612, USA","phoneNumber":"510-587-9696","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8113159,-122.2682245],"email":"info@transgenderlawcenter.org","socialMedia":null,"title":"Transgender Law Center","description":"Transgender Law Center es la organización nacional más grande liderada por personas trans que aboga por la autodeterminación para todas las personas. Mediante el mantenimiento de sólidos recursos y publicaciones, el Centro guía a las individuos a través de los desafíos y preguntas legales comunes que enfrentan las personas transgénero. TLC también empodera a las comunidades hacia un movimiento de liberación nacional a largo plazo liderado por personas trans."},{"id":"88a19313-994c-4908-a518-c09b531743e9","slug":"deutsche-gesellschaft-fur-transidentitat-und-intersexualitat","externalUrl":"https://dgti.org/","tags":["transmasculine","transfeminine","non-binary","legal","healthcare","education-awareness"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/dgti.eV","twitterUrl":"https://twitter.com/dgti_eV","instagramUrl":"https://www.instagram.com/dgti_ev/","youtubeUrl":"https://www.youtube.com/channel/UCvPv3gwmnZcU5JT-06vxJrA"},"title":"Deutsche Gesellschaft für Transidentität und Intersexualität","description":"La Deutsche Gesellschaft für Transidentität und Intersexualität (dgti) es una sociedad profesional a nivel nacional en Alemania que aboga por la aceptación y la igualdad de personas trans, intergénero, no binarias y agénero en todos los niveles de la sociedad. La dgti proporciona consulta de igual a igual, información legal, noticias y tiene varios programas de recursos para consultores trans* y profesionales médicos."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"El Círculo Interior","description":"Una comunidad musulmana global destinada a brindar sanación a los musulmanes que son marginados en base a la orientación sexual y la identidad de género a través de la espiritualidad, la educación y la construcción de movimiento"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Inicio de Cambio de Nombre en Florida","description":"Este sitio web proporciona una guía paso a paso para aquellos que desean actualizar su nombre o género en Florida. Los pasos incluyen presentar una petición en tribunal y actualizar la tarjeta de seguro social, licencia de conducir, pasaporte y certificado de nacimiento."},{"id":"91296a03-5c7f-4105-9ba7-2aa9e8bf5223","slug":"parents-of-gender-diverse-children","externalUrl":"https://www.pgdc.org.au/","tags":["parent-family-resources","support-groups","education-awareness","mental-health","youth-services"],"address":null,"phoneNumber":"03 9663 6733","country":"AU","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":"info@pgdc.org.au","socialMedia":{},"title":"Padres de Niños de Diversidad de Género","description":"Padres de Niños de Diversidad de Género provee apoyo, conexiones y recursos a padres y a aquellos que están criando niños transgéneros y de diversidad de género en Australia. La organización ofrece soporte de pares confidencial y sin prejuicios, encuentros mensuales, un Centro de Padres en línea, y desarrollo profesional y oradores."},{"id":"92920c87-b8c4-4179-a98b-7c9b036c8b1a","slug":"amsterdam-umc-kennis-en-zorgcentrum-genderdysforie","externalUrl":"https://www.amc.nl/web/specialismen/genderdysforie.htm","tags":["healthcare","education-awareness"],"address":"De Boelelaan 1117, 1081 HV Amsterdam, Netherlands","phoneNumber":"+31(0)20 444 0542","country":"NL","provinceOrState":"NH","city":"Amsterdam","county":"Amsterdam","latLng":[52.3346104,4.8598083],"email":"genderteam-poli@vumc.nl","socialMedia":{"instagramUrl":"https://www.instagram.com/genderteam_amsterdamumc"},"town":"Amsterdam-Zuid","title":"Amsterdam UMC - Centro de Conocimiento y Cuidado de la Disforia de Género","description":"El Centro de Conocimiento y Cuidado para la Disforia de Género en Amsterdam UMC se especializa en proporcionar tratamiento médico y apoyo psicológico a las personas que sienten que su género de nacimiento no coincide con su identidad. El centro abraza la diversidad individual, adapta sus servicios a las necesidades personales y es reconocido internacionalmente por su experiencia en el tratamiento de la incongruencia de género. También lleva a cabo investigaciones para mejorar la comprensión y el tratamiento de las personas transgénero y ofrece formación a nuevos profesionales de la salud."},{"id":"9e09fcfd-eb5b-4dd9-825c-ae3c3c5ce940","slug":"trans-lifeline-peer-support-and-resources","externalUrl":"https://translifeline.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships"],"address":null,"email":null,"phoneNumber":"(877) 565-8860","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TransLifeline/","twitterUrl":"https://twitter.com/TransLifeline","instagramUrl":"https://www.instagram.com/translifeline/?hl=en","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Trans Lifeline","description":"Trans Lifeline es una organización liderada por trans que ofrece apoyo entre pares y recursos para la comunidad transgénero. Con un enfoque en el apoyo comunitario, las microsubvenciones y una línea directa, su objetivo es proporcionar a las personas trans las conexiones y recursos que necesitan para prosperar. Trans Lifeline también aboga por la comunidad trans a través de iniciativas como #SafeHotlines."},{"id":"a0bc83c3-3566-4529-9560-bf98eb404461","slug":"transliving-international","externalUrl":"https://transliving.co.uk/main/","tags":["support-groups","community-stories","education-awareness","clothing"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Transliving International","description":"Transliving International es un grupo de apoyo global para la comunidad transgénero que proporciona una revista en línea, noches de club, eventos y una plataforma de compras. Amplifica la voz de todas las personas diversas y transgénero al ofrecer ayuda, consejos, historias personales y características."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"The Trevor Project","description":"The Trevor Project es una organización sin fines de lucro estadounidense que proporciona servicios de prevención de suicidio a jóvenes LGBTQ+. El sitio proporciona recursos valiosos para la comunidad transgénero, incluyendo intervención en crisis y línea de vida de prevención de suicidio, TrevorChat, y TrevorText, así como orientación sobre salud mental, servicios sociales y grupos de apoyo."},{"id":"a4f258ec-17b7-4477-bd90-a7580ab66086","slug":"gender-dysphoria-1177-vaardguiden","externalUrl":"https://www.1177.se/liv--halsa/konsidentitet-och-sexuell-laggning/konsdysfori/","tags":["healthcare"],"address":null,"phoneNumber":null,"country":"SE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Disforia de género - 1177 Vårdguiden","description":"Un recurso integral sobre la disforia de género proporcionado por la guía de atención médica 1177 en Suecia, que discute qué es, cómo se siente, cómo buscar ayuda y diversas opciones de tratamiento. Sirve proporcionando información detallada para aquellos que experimentan disforia de género y apoyándolos en su viaje."},{"id":"a58acbca-7d7d-4c6d-8d5f-f1a281e0f8b9","slug":"pronoun-dressing-room","externalUrl":"http://www.pronouns.failedslacker.com/","tags":["non-binary","transmasculine","transfeminine","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Vestidor de Pronombres","description":"El Vestidor de Pronombres proporciona un espacio en línea donde las personas pueden probar y explorar diferentes conjuntos de pronombres para ver cuáles se sienten bien para ellos. El sitio web facilita una decisión más fácil en la selección de pronombres para la comunidad transgénero, permitiéndoles ver cómo podrían verse diferentes pronombres en diferentes contextos."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"Un Lugar para Marsha","description":"Un Lugar para Marsha es uno de muchos proyectos de inicio orientados a ayudar a individuos y familias Trans en estados cada vez más peligrosos a un lugar más seguro. ULPM comenzó su viaje en marzo de 2023 en reacción al auge de la legislatura anti-trans en toda la nación. Ahora ULPM se enfoca en emparejar a los refugiados de los estados rojos como compañeros de cuarto, manejando cuidadosamente un hogar a la vez."},{"id":"af3483e3-d7f7-49d7-a4e9-b70e566bee98","slug":"good-hope-metropolitan-community-church","externalUrl":"https://www.goodhopemcc.org","tags":["spiritual"],"address":"18 Belmont Rd, Rondebosch, Cape Town, 7700, South Africa","phoneNumber":null,"country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9605258,18.474311],"email":"secretary@goodhopemcc.org","socialMedia":{"facebook":"https://www.facebook.com/goodhopemcc"},"town":"Rondebosch","title":"Iglesia Metropolitana de BUENA ESPERANZA","description":"Una comunidad cristiana inclusiva y teológicamente progresista fundada en los principios de Jesucristo que celebra la diversidad y proporciona un espacio seguro y sin prejuicios donde todos son bienvenidos. Parte de una congregación cristiana inclusiva con sede en Ciudad del Cabo, Sudáfrica y parte de la denominación internacional más grande conocida como Iglesias Metropolitanas de la Comunidad (MCC)."},{"id":"b2741990-69b4-4fbd-98e7-933b8932425f","slug":"transfamily","externalUrl":"https://www.transfamily.org.au/","tags":["support-groups","parent-family-resources","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/Transfamily-Australia-126186690851106/"},"title":"Transfamily","description":"Un grupo de apoyo entre pares para padres, hermanos, familia extendida y amigos de una persona trans y diversa en términos de género. Ofrece recursos, eventos y una plataforma para historias de la comunidad. También ofrece un libro de Transfamily que proporciona información útil y perspectivas sobre la comunidad transgénero."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons ofrece servicios de control y liberación de voz de calidad para individuos transgénero y no binarios que buscan sonar más masculinos, femeninos o andróginos."},{"id":"b86b3697-6f65-4fd1-8506-e2ce879a614c","slug":"working-it-out-tasmania","externalUrl":"https://www.workingitout.org.au/","tags":["non-binary","transmasculine","transfeminine","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"TAS","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Resolviéndolo","description":"Working It Out es el servicio de apoyo y educación de Tasmania para la sexualidad, género y estado intersexual. Proporciona servicios de apoyo y defensa para los tasmanios LGBTIQ+ y programas de educación y formación para escuelas, lugares de trabajo, gobierno y organizaciones no gubernamentales."},{"id":"b933717d-90e3-4aff-a61f-bd1fd1f2893b","slug":"thorne-harbour-health","externalUrl":"https://thorneharbour.org/","tags":["healthcare","support-groups","mental-health","social-services","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Thorne Harbour Health","description":"Una organización controlada por la comunidad LGBTIQ+ que brinda servicios de salud y bienestar para las comunidades diversas en cuanto a sexo, género y sexualidad, incluyendo apoyo y prevención del VIH, consejería y servicios de violencia familiar."},{"id":"ba3e158a-53b6-4dc5-a220-4a065859aa7f","slug":"queer-lexikon","externalUrl":"https://queer-lexikon.net/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","support-groups","education-awareness","community-stories"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"twitterUrl":"fab fa-twitter","facebookUrl":"fab fa-facebook","instagramUrl":"fab fa-instagram","youtubeUrl":"fab fa-youtube","patreonUrl":"fab fa-patreon","tumblrUrl":"fab fa-tumblr","linkedinUrl":"fab fa-linkedin-in","emailUrl":"fas fa-envelope"},"title":"Queer Lexikon","description":"Queer Lexikon es un recurso en línea que proporciona información y apoyo extensos para la comunidad queer. Cubre temas que varían desde diversidad sexual, romántica, de género hasta salud mental y grupos de apoyo. Es un centro para la educación, conciencia y relatos comunitarios."},{"id":"bc49f848-fa04-47ff-af81-cb500214ce61","slug":"transformering-se","externalUrl":"https://transformering.se/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness"],"address":"Stockholm, Sweden","phoneNumber":null,"country":"SE","provinceOrState":"Stockholm County","city":"Stockholm","latLng":[59.32932349999999,18.0685808],"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"twitterUrl":"https://twitter.com/rfslungdom","instagramUrl":"https://www.instagram.com/rfsl_official","facebookUrl":"http://www.facebook.com/transformering"},"title":"Transformering.se","description":"Un centro de recursos sueco administrado por RFSL Ungdom y RFSL que ofrece apoyo e información relacionada con problemas de identidad de género y transgénero. Los contenidos incluyen derechos, relaciones y cómo funciona la atención que confirma el género. Está diseñado para personas que son transgénero, tienen experiencia trans personal, o están cuestionando su identidad/expresión de género, así como sus seres queridos, profesionales o trabajadores voluntarios que los apoyan."},{"id":"be017772-af87-4920-ae62-1a3e961d216a","slug":"transamsterdam","externalUrl":"https://www.transamsterdam.nl/","tags":["artists-creators","education-awareness"],"address":"Linnaeusstraat 89, 1093 EK Amsterdam, Netherlands","phoneNumber":null,"country":"NL","provinceOrState":"NH","city":"Amsterdam","county":"Amsterdam","latLng":[52.35914529999999,4.9263607],"email":"info@transamsterdam.nl","socialMedia":{"linktr":"linktr.ee/transamsterdam"},"town":"Amsterdam-Oost","title":"TransAmsterdam","description":"TransAmsterdam es una organización trans enfocada en el arte, la cultura y el estilo de vida en Ámsterdam. Apoya a la comunidad transgénero a través de varios pilares. Estos incluyen la creación de oportunidades para conocerse a través de Trans & Friends café, InClusion y otros eventos. También promueve el desarrollo del talento a través de talleres, reuniones temáticas y producciones teatrales en Trans Art School. Finalmente, ofrece una plataforma de arte y cultura para y por artistas y intérpretes transgénero y no binarios."},{"id":"be5fc820-136d-4e7f-a3b5-ae6d103ef1ad","slug":"gender-centre","externalUrl":"https://gendercentre.org.au/","tags":["transmasculine","transfeminine","non-binary","mental-health","social-services","support-groups","education-awareness","healthcare"],"address":null,"phoneNumber":"02 9519 7599","country":"AU","provinceOrState":null,"city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"The Gender Centre Inc.","description":"The Gender Centre Inc. proporciona una amplia gama de servicios especializados que permiten la exploración de la identidad de género y la ayuda para aliviar la disforia de género. Apoya a las personas trans y de género expresivo en cada etapa de su viaje mientras exploran y viven su auténtico sentido de sí mismos. Ofrece alojamiento, administración de casos, educación y formación, servicios de consejería y salud mental, grupos, noticias y recursos."},{"id":"bfc56737-9f48-4344-8a0e-22ae450d5250","slug":"learning-with-love-the-2023-pflag-national-convention","externalUrl":"https://pflag.org/","tags":["education-awareness","support-groups","parent-family-resources","community-stories"],"address":"Washington, DC, USA","phoneNumber":null,"country":"US","provinceOrState":"DC","city":"Washington","county":"District of Columbia","latLng":[38.9071923,-77.0368707],"email":null,"socialMedia":null,"title":"Aprendiendo con Amor: La Convención Nacional PFLAG 2023","description":"Un evento de cuatro días organizado por PFLAG para conectar, crear redes, aprender y compartir experiencias. La convención albergará talleres, paneles y presentaciones para apoyar su misión de crear un mundo solidario, justo y afirmativo para las personas LGBTQ+ y aquellos que los aman."},{"id":"c23736ad-03dc-41dd-b8f9-4f64b2727cdc","slug":"freedom-centre-wa","externalUrl":"https://www.freedom.org.au/","tags":["youth-services","mental-health","social-services","support-groups","education-awareness","parent-family-resources"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"WA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/FreedomCentrePerth","instagramUrl":"https://www.instagram.com/freedom_centre/"},"title":"Freedom Centre","description":"Freedom Centre proporciona una amplia gama de servicios de apoyo para jóvenes LGBTIQA+ en todo WA, incluyendo sesiones de entrada libre, desarrollo comunitario, asesoramiento y mucho más. Trabajan para hacer que todos los jóvenes LGBTIQA+ se sientan incluidos, conectados y respetados. También proporcionan formación y orientación a padres, profesionales, comunidades y organizaciones."},{"id":"c4437a30-c2e0-4672-8f37-74de08818f97","slug":"point-of-pride","externalUrl":"https://www.pointofpride.org/","tags":["transmasculine","transfeminine","non-binary","healthcare","financial-aid-scholarships"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Punto de Orgullo","description":"Punto de Orgullo ofrece ayuda financiera y apoyo directo a las personas trans que necesitan atención de salud y bienestar. Los programas de ayuda varían desde fondos anuales para cirugías transgénero, fondos de acceso a HRT, apoyo a la electrólisis y provision de fajas de pecho gratuitas y ropa interior femenina a personas trans que no pueden pagarlas o encontrarlas de manera segura."},{"id":"c6a77c4c-7aa3-47b3-b385-8573e1ba3a78","slug":"transmann-ev","externalUrl":"https://transmann.de/","tags":["transmasculine","non-binary","healthcare","mental-health","support-groups","education-awareness"],"email":"info@transmann.de","socialMedia":{},"title":"TransMann e.V.","description":"TransMann e.V. es una organización voluntaria, sin fines de lucro que proporciona un amplio rango de apoyo para todas las personas Trans* e Inter* de Mujer-a-Hombre (FzM/FtM) en toda Alemania. Los servicios incluyen reuniones grupales, información y recursos en línea, asesoramiento de Par-a-Par, materiales educativos y apariciones públicas. También mantienen una base de datos a nivel nacional de médicos y terapeutas con experiencia en Trans*. Aunque su público principal son las personas FzM-Trans* e Inter*, también extienden sus recursos y apoyo a familiares, amigos, parejas, instituciones educativas y empleadores."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailway.org","description":"Una vital plataforma en línea dedicada a asistir y abogar por los individuos LGBTQ+ que enfrentan persecución y violencia en todo el mundo. Con un compromiso inquebrantable, el sitio web conecta a aquellos en peligro inmediato con recursos que salvan vidas, asistencia de emergencia y vías seguras hacia la seguridad. A través de asociaciones con organizaciones locales y una red de simpatizantes compasivos, RainbowRailroad.org trabaja incansablemente para proporcionar defensa, asistencia legal y apoyo para la reubicación, permitiendo a las personas escapar de la persecución y encontrar refugio. Al defender los derechos humanos, salvar vidas y fomentar un mundo más inclusivo, RainbowRailroad.org sirve como un faro de esperanza y protección para las personas LGBTQ+ que buscan seguridad y libertad."},{"id":"cfb4d1a4-0142-4dfa-b152-8e577885e98c","slug":"blaq-aboriginal-corporation","externalUrl":"https://blaq.org.au/","tags":["community-stories","education-awareness","social-services","support-groups"],"address":"Redfern NSW 2016, Australia","phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Redfern","county":"City of Sydney","latLng":[-33.892215,151.205873],"email":"admin@blaq.org.au","socialMedia":null,"title":"Corporación Aborigen BlaQ","description":"La Corporación Aborigen BlaQ es una organización comunitaria dedicada a apoyar y empoderar a la comunidad LGBTQ+SB aborigen e isleña del Estrecho de Torres a través de la innovación, inclusión, comprensión y defensa."},{"id":"d21dfad9-22c7-4a42-9658-d1c573100c33","slug":"baby-making-for-everybody","externalUrl":"https://www.babymakingforeverybody.com/","tags":["parent-family-resources","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Creación de Bebés para Todos","description":"Una guía práctica y celebración de diversos métodos de creación de familias fuera del modelo tradicional de familia nuclear heterosexual para padres LGBTQ+ y solteros. El libro proporciona una guía paso a paso junto con narrativas personales, proporcionando a los futuros padres un plan para expandir sus familias."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"El Proyecto McKenzie","description":"Un recurso integral que ofrece servicios, programas y eventos destinados a promover la justicia de género y servir a la comunidad transgénero. Incluye servicios de apoyo y recursos que incluyen atención médica, asistencia legal, servicios de salud mental y más."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Consejería Trans & Queer de East Bay","description":"La Consejería Trans & Queer de East Bay ofrece servicios a escala móvil que incluyen: Terapia individual ubicada en el centro de Berkeley, CA. Apoyo a través de la exploración de género y la transición. Cartas de recomendación para hormonas y cirugía. Capacitaciones profesionales para proveedores de salud mental, estudiantes y empleadores. Sam Davis es un trabajador social clínico con licencia (LCSW) transgender, genderqueer que se especializa en trabajar con adolescentes y adultos trans, queer, genderqueer y que no se conforman con el género. Tienen 16 años de experiencia como proveedor de salud mental en East Bay, incluyendo la facilitación de grupos de apoyo entre pares, educación comunitaria en conferencias LGBTQI, y 9 años de práctica clínica y consejería en crisis con personas severamente marginadas para el Condado de Alameda. Son un defensor fuerte y comprometido con una larga historia de organización en nombre de las personas marginadas."},{"id":"dcb18ebe-596d-4d3e-a409-542f06a109a7","slug":"seahorse-victoria-club","externalUrl":"https://seahorsevic.com.au/","tags":["support-groups","community-stories","friendly-businesses"],"address":"St Kilda VIC 3182, Australia","phoneNumber":"0401 455 198","country":"AU","provinceOrState":"VIC","city":"St Kilda","county":"Port Phillip","latLng":[-37.864,144.982],"email":"seahorsevic@gmail.com","socialMedia":{"yelpUrl":null,"googleMapsUrl":null},"title":"Seahorse Victoria Club","description":"Est. 1975, Seahorse Club Victoria proporciona recursos, servicios comunitarios y apoyo para la comunidad transgénero. Incluye un directorio de servicios amigable para trans y una próxima plataforma en línea para que los miembros se conecten."},{"id":"df4d32c7-5d7c-4b96-9d3f-60d57d639747","slug":"family-equality","externalUrl":"https://www.familyequality.org/","tags":["legal","education-awareness","parent-family-resources","support-groups"],"address":"475 Park Ave S #2100, New York, NY 10016, USA","phoneNumber":null,"country":"US","provinceOrState":"NY","city":"New York","county":"New York County","latLng":[40.7454596,-73.98217389999999],"email":null,"socialMedia":null,"town":"Manhattan","title":"Igualdad Familiar","description":"Igualdad Familiar es una organización sin fines de lucro dedicada a proteger y apoyar a las familias LGBTQ+. Luchan por protecciones legales, proporcionan recursos y educación, y abogan activamente por los derechos LGBTQ+. Esta organización organiza varios eventos y ayuda a conectar familias entre sí y con la comunidad LGBTQ+ más amplia."},{"id":"e20d344a-9e07-44b6-8b9e-c21554a1cda6","slug":"a-complete-guide-to-transmasculine-reproduction","externalUrl":"https://transmasculinereproduction.sites.ucsc.edu/","tags":["transmasculine","healthcare","education-awareness","parent-family-resources","support-groups"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Una guía completa sobre la reproducción transmasculina","description":"Una guía completa que ofrece información sobre la fertilidad transmasculina, el embarazo, el posparto, la lactancia y la paternidad. El recurso incluye proveedores de atención médica que afirman la transición, preguntas frecuentes investigadas, varios recursos y más para educar y apoyar a las personas transmasculinas en su viaje hacia la paternidad."},{"id":"e51c019c-8dfe-498e-b82e-4263a8f747e8","slug":"equality-florida","externalUrl":"https://www.eqfl.org/","tags":["legal","healthcare","education-awareness"],"address":null,"country":"US","provinceOrState":"FL","city":"St. Petersburg","county":null,"latLng":null,"email":null,"phoneNumber":"813-870-3735","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/equalityfl/","twitterUrl":"https://twitter.com/EqualityFlorida","instagramUrl":"https://www.instagram.com/equalityfl/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Equality Florida","description":"La organización de defensa LGBTQ más grande de Florida que trabaja hacia escuelas seguras y saludables, equidad en salud LGBTQ, defensa del VIH, protecciones LGBTQ y más. La organización realiza varios eventos y ha asegurado apoyos pro-igualdad, contribuyendo a becas de atención médica para personas transgénero."},{"id":"e5b7c0b6-7106-4426-9809-7d59ebed9ec6","slug":"transhub","externalUrl":"https://www.transhub.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","health-providers","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransHub","description":"TransHub es una plataforma digital de información y recursos para todas las personas trans y de género diverso en NSW, sus seres queridos, aliados y proveedores de salud. Proporciona acceso a información y recursos muy necesarios para una comunidad que puede no haber tenido acceso a estos mientras crecía o se acercaba a su auténtico yo. La información varía desde necesidades médicas como hormonas, cirugías y listas de médicos hasta problemas sociales y legales."},{"id":"e7d26256-017c-4d7e-90d2-30de9386cc03","slug":"twenty10","externalUrl":"https://twenty10.org.au/","tags":["transmasculine","non-binary","transfeminine","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/twenty10glcs/"},"title":"Twenty10","description":"Twenty10, incluyendo GLCS, proporciona varios servicios que cambian la vida a los jóvenes en NSW que se identifican como lesbianas, gays, bisexuales, transgénero o de género diverso, intersexuales, queer, asexuales o que están cuestionando su identidad. Sus servicios incluyen admisión y derivación, vivienda y gestión de casos, asesoramiento, programas de apoyo social y capacitación en inclusividad LGBTIQA+"},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"Mapa Transgénero","description":"Transgendermap.com es un recurso en línea dirigido a proporcionar información práctica y orientación a las personas que están cuestionando su identidad de género o que se encuentran en algún lugar del espectro transgénero. El sitio web incluye una amplia gama de temas, como la comprensión de la terminología transgénero, los procesos de transición, los problemas legales, la atención sanitaria y numerosas historias personales. Su objetivo es ayudar a las personas a navegar por sus viajes personales, proporcionando un \'mapa\' o guía de los muchos aspectos de la identidad de género y las experiencias transgénero. Por favor, visite el sitio actual para obtener la información más actual y precisa."},{"id":"ef7f242d-4d3a-4615-ab35-422dcc90f493","slug":"the-genderaid","externalUrl":"https://genderaid.org/en","tags":["healthcare","education-awareness"],"address":"De Boelelaan 1117, 1081 HV Amsterdam, Netherlands","phoneNumber":null,"country":"NL","provinceOrState":"NH","city":"Amsterdam","county":"Amsterdam","latLng":[52.3346104,4.8598083],"email":"info@genderaid.org","socialMedia":null,"town":"Amsterdam-Zuid","title":"El GenderAid","description":"El GenderAid es una herramienta de decisión para la cirugía de género genital, con el objetivo de proporcionar información completa y confiable sobre las opciones de tratamiento. Se centra en el sistema de atención médica holandés, adhiriéndose a las pautas de la WPATH, y ha sido desarrollado para todas las partes de la comunidad transgénero, incluyendo personas no binarias, de género fluido y género queer."},{"id":"f0aa7c03-8837-40f8-82aa-03beb0ac46cc","slug":"transfolk-of-wa","externalUrl":"https://www.transfolkofwa.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"WA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransFolk de WA","description":"Un servicio de apoyo entre compañeros para personas transgénero y sus seres queridos en Australia Occidental. Ofreciendo grupos en línea, servicios y recursos recomendados, y organizando diversos eventos."},{"id":"f2625d38-e181-4231-8344-214adb6edf36","slug":"transcend-australia","externalUrl":"https://transcend.org.au/","tags":["support-groups","parent-family-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Transcend Australia","description":"El propósito de Transcend Australia es apoyar, afirmar y celebrar las vidas de los niños trans y de género diverso y sus familias y cuidadores. Proporcionan información, apoyo y referencias a familias en toda Australia y trabajan para empoderar a los niños y jóvenes trans y de género diverso."},{"id":"f48634db-fe71-426c-be84-622b3282bad7","slug":"planned-parenthood","externalUrl":"https://www.plannedparenthood.org/","tags":["healthcare","mental-health","education-awareness"],"address":null,"phoneNumber":"1-800-230-7526","country":"US","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Planned Parenthood","description":"Planned Parenthood proporciona atención de salud reproductiva vital, educación sexual e información a millones de personas en todo el mundo. Los servicios incluyen aborto, control de natalidad, pruebas y tratamiento de ETS, terapia de hormonas transgénero y más. Citas en línea y telemedicina disponibles."},{"id":"f596a8bb-1a7d-4b86-a865-c6d6a17984bc","slug":"rfsl-swedish-federation-lgbtq-rights","externalUrl":"https://www.rfsl.se/","tags":["transmasculine","transfeminine","non-binary","legal","healthcare","mental-health","social-services","education-awareness","support-groups"],"address":null,"phoneNumber":null,"country":"SE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{},"title":"RFSL - La Federación Sueca para los Derechos de Lesbianas, Gays, Bisexuales, Transgénero y Queer","description":"RFSL es una organización sueca que trabaja con y para los derechos LGBTQ. Proporcionan recursos esenciales, apoyo comunitario, educación y concientización, orientación jurídica, servicios de salud y más para la comunidad transgénero. RFSL también promueve los derechos LGBTQ a nivel internacional."},{"id":"f8b46156-9e3c-4347-aa8a-1df0f89e8f25","slug":"apotheek-all-about-medication","externalUrl":"https://www.apotheek.nl/","tags":["healthcare","education-awareness"],"address":null,"phoneNumber":null,"country":"NL","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Apotheek.nl - Todo sobre Medicamentos","description":"Un recurso que ofrece información confiable sobre varios medicamentos. El sitio incluye videos, actualidad en salud, información sobre vacunación, coronavirus y atención farmacéutica. Proporciona información en neerlandés y traduce 50 medicamentos clave para refugiados ucranianos."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"Familias Trans","description":"Familias Trans inspira esperanza, aumenta la comprensión y crea un camino visible para apoyar a niños trans y de género diverso y a todos aquellos que tocan sus vidas. Proporcionamos recursos, organizamos eventos y conectamos familias a grupos de apoyo."}]')}}]);